import React, { useRef } from 'react';
import './App.css';
import { useEffect } from 'react';

function App() {
  const datePickerElement = useRef();

  function toggleDatePicker(e) {
    console.log('cick')
  }

  useEffect(() => {
    datePickerElement.current.addEventListener('click', toggleDatePicker);
  }, [])

  return (
    <div className="date-picker" ref={datePickerElement}>
      <div className="selected-date">30/01/2020</div>
      <div className="dates">
        <div className="month">
          <div className="arrows prev-month"></div>
          <div className="label-month"></div>
          <div className="arrow next-month"></div>
        </div>
        <div className="days"></div>
      </div>
    </div>
  );
}

export default App;
